import React, { useState } from 'react';
import { useNavigation } from '@react-navigation/native';
import { View, Text, TouchableOpacity, Image } from 'react-native';
import { Entypo, AntDesign } from 'react-native-vector-icons';
import { launchCamera, launchImageLibrary } from 'react-native-image-picker';

import styles from './styles';
import { AuthLayout, FormInput, Nav, TextButton } from '../../../components';
import { COLORS, validateEmail, validatePassword } from '../../../utils';
import DefaultImage from '../../../assets/default_avatar.jpg';

const SignIn = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [emailError, setEmailError] = useState('');
  const [showPassword, setShowPassword] = useState(false);
  const [showConfirmPassword, setShowConfirmPassword] = useState(false);
  const [name, setName] = useState('');
  const [nameError, setNameError] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [passwordError, setPasswordError] = useState('');
  const [confirmPasswordError, setConfirmPasswordError] = useState('');

  const { navigate } = useNavigation();

  const handleOpenGallary = () => {};
  const handleOpenCamera = () => {};

  return (
    <>
      <AuthLayout title="Sign Up" titleContainerStyle={styles.title}>
        <FormInput
          label="Name"
          containerStyle={styles.emailComponent}
          onChange={value => setName(value)}
          errorMsg={nameError}
          appendComponent={
            <View style={styles.emailAppendContainer}>
              <AntDesign
                name={'checkcircle'}
                style={{
                  height: 25,
                  width: 30,
                  fontSize: 21,
                  color:
                    name === '' && nameError === ''
                      ? COLORS.grey
                      : name !== ''
                      ? COLORS.green
                      : COLORS.red,
                }}
              />
            </View>
          }
        />

        <FormInput
          label="Email"
          containerStyle={styles.emailComponent}
          keyboardType="email-address"
          autoCompleteType="email"
          onChange={value => {
            validateEmail(value, setEmailError);

            setEmail(value);
          }}
          errorMsg={emailError}
          appendComponent={
            <View style={styles.emailAppendContainer}>
              <AntDesign
                name={'checkcircle'}
                style={{
                  height: 25,
                  width: 30,
                  color:
                    email === ''
                      ? COLORS.grey
                      : email !== '' && emailError === ''
                      ? COLORS.green
                      : COLORS.red,
                  fontSize: 21,
                }}
              />
            </View>
          }
        />

        <FormInput
          label="Password"
          secureTextEntry={!showPassword}
          autoCompleteType="password"
          onChange={value => {
            validatePassword(value, setPasswordError);

            setPassword(value);
          }}
          errorMsg={passwordError}
          appendComponent={
            <TouchableOpacity
              style={styles.passwordAppendContainer}
              onPress={() => setShowPassword(!showPassword)}
            >
              <Entypo
                name={showPassword ? 'eye-with-line' : 'eye'}
                style={styles.passwordAppendImage}
              />
            </TouchableOpacity>
          }
        />

        <FormInput
          label="Confirm Password"
          secureTextEntry={!showConfirmPassword}
          autoCompleteType="password"
          containerStyle={styles.passwordContainer}
          onChange={value => {
            setConfirmPasswordError('');

            if (password !== value)
              setConfirmPasswordError('You Passwords donot match');

            setConfirmPassword(value);
          }}
          errorMsg={confirmPasswordError}
          appendComponent={
            <TouchableOpacity
              style={styles.passwordAppendContainer}
              onPress={() => setShowPassword(!showPassword)}
            >
              <Entypo
                name={showPassword ? 'eye-with-line' : 'eye'}
                style={styles.passwordAppendImage}
              />
            </TouchableOpacity>
          }
        />

        <Text style={styles.lebel}>Avatar</Text>

        <View style={styles.avatarContainer}>
          <View style={styles.avatarPreviewContainer}>
            <Image source={DefaultImage} style={styles.avatarPreview} />
          </View>

          <View style={styles.avatarActions}>
            <TextButton
              onPress={handleOpenGallary}
              text="Open Gallary"
              containerStyle={null}
              touchStyle={null}
              textStyle={styles.signInButtonText}
            />

            <Text style={styles.signInText}> or </Text>

            <TextButton
              onPress={handleOpenCamera}
              text="Open Camera"
              containerStyle={null}
              touchStyle={null}
              textStyle={styles.signInButtonText}
            />
          </View>
        </View>

        <TextButton onPress={() => {}} text="Sign Up" />

        <View style={styles.signInContainer}>
          <Text style={styles.signInText}>Already have an account? </Text>

          <TextButton
            onPress={() => navigate('Sign In')}
            text="Sign In"
            containerStyle={null}
            touchStyle={null}
            textStyle={styles.signInButtonText}
          />
        </View>
      </AuthLayout>

      <Nav />
    </>
  );
};

export default SignIn;
